	if work then
		return 'Enabled'
	else
		return 'Disabled'
	end
end

local getName = function()
	local state, info = pcall(MarketplaceServ.GetProductInfo, MarketplaceServ, game.PlaceId);
	return state and info.Name or 'N/A';
end

function PrivateServerCheck()
	if game.PrivateServerOwnerId ~= 0 then
		return "True"
	else
		return "False"
	end
end
local getTotal = function(id)
	local suc, err = pcall(function()
		local web = HttpServ:GetAsync("https://www.rprxy.xyz/games/".. id);
		local text = string.find(web, "Playing");
		local new = string.sub(web, text);
		local n_start = string.find(new, ">");
		new = string.sub(new, n_start);
		local n_end = string.find(new, "<") ;
		new = string.sub(new, 2, n_end - 1);
		local players = string.gsub(new, ",", "");
		return tonumber(players) + 1;
	end)
	if err then
		return "Disabled"
	end
end


